import React from 'react';
import HomeCard from './homecard';
import '../../../css/home/homecard.css';

export default class HomeCardArea extends React.Component {
  render() {
    return (
      <div className="home-card-area">
        <HomeCard key={1} cardId={1} cardUrl="/blog" cardName="Blog" />
        <HomeCard key={2} cardId={2} cardUrl="/demo" cardName="Demo" />
        <HomeCard key={3} cardId={3} cardUrl="/about" cardName="About Me" />
      </div>
    );
  }
}
